export class Target {
    constructor() {
        this.targets = [];
    }
    static create() {
        return new Target();
    }
    static byFilter(filters, name, isOlap) {
        return new Target().add(filters, name, isOlap);
    }
    add(filters, name, isOlap) {
        this.targets.push({
            filters: filters,
            name: name,
            isOlap: isOlap,
        });
        return this;
    }
    toGlobalEmbedTarget() {
        return this.targets.map(x => {
            return {
                name: x.name,
                filters: x.filters.toGlobalEmbedFilters(),
                olap: x.isOlap,
            };
        });
    }
}
